def get_words(length):
    """Returns a list of words from a string of text."""
    list_of_words = lorem_ipsum_text.split()
    max_length = len(list_of_words)
    if length > max_length:
        return " ".join(lorem_ipsum_text.split()[0:max_length])
    return " ".join(lorem_ipsum_text.split()[0:length])

def get_sentences(length):
    """Returns a list of sentences from a string of text."""
    list_of_sentences = lorem_ipsum_text.split(".")
    max_length = len(list_of_sentences)
    if length > max_length:
        return ".".join(lorem_ipsum_text.split(".")[0:max_length])
    return ".".join(lorem_ipsum_text.split(".")[0:length]) + "."

