def get_paragraphs(length):
    """Returns a list of paragraphs from a string of text."""
    list_of_paragraphs = lorem_ipsum_text.split("\n\n")
    max_length = len(list_of_paragraphs)
    if length > max_length:
        return "\n\n".join(lorem_ipsum_text.split("\n\n")[0:max_length])
    return "\n\n".join(lorem_ipsum_text.split("\n\n")[0:length])

